import React, { useEffect } from 'react'

const Dashboard = () => {
  useEffect(() => {
    (async () => {
      const access_token = localStorage.getItem('access_token');
      if (!access_token) {
        window.location.href = '/auth';
      }
    })()
  }, [])
  return (
    <div>Dashboard</div>
  )
}

export default Dashboard
